import User from './User';
import styles from './UserList.module.css';

const UserList = props => {
    const [currentUsers, setCurrentUsers] = useState('');
    let testUsers = [
        {userName: 'bob'},
        {userName: 'frank'},
        {userName: 'Joe'}
    ];

    return (
        testUsers.map( (user) => {
            <User userName={user.userName} />
        })
    );
}
export default UserList;
